import React from 'react';
import {useState, useEffect} from 'react';
import Axios from 'axios';

function Search() {

    const [loginList, setLoginList] = useState([])

    function getLogins() {
      Axios.get("http://localhost:4500/view-all").then((response) => {
        setLoginList(response.data)
      }
    )};

    function createNameArray(logins) {
        const nameArray = []
        logins.map((login) => nameArray.push(login.websiteName))
    return(
        nameArray
        )
    }

    useEffect(() => {getLogins()},[]);

    const listOfSites = createNameArray(loginList)
    console.log(listOfSites)


  return (
    <div>
      <h1>Search Page</h1>
      <div class="input-group">
        <div class="form-outline">
            <input type="search" id="form1" class="form-control" />
            <label class="form-label" for="form1">Search</label>
        </div>
        <button type="button" class="btn btn-primary">
            <i class="fas fa-search"></i>
        </button>
        </div>
    </div>
  )
}

export default Search
